        //     <input type='text' className='data_edit' defaultValue={x[2]}></input>
        // </div>)
    }
    return lista
    }

  render() {
      console.log(this.props.data.pdfContent.raw)
    // let items = this.to_list()
    // let itemList=items.map((item)=>{
    //     return(
    //         <div className='card_data'>
    //              <h4 className='title'>{item[0]}</h4>
    //              <p className='subtitle'>{item[1]}</p>
    //              <input type='text' className='data_edit' defaultValue={item[2]}></input>
    //          </div>
    //     ) 
    //   })
    return (
      <div>
        <h1 className='title' >Conteúdo Extraído</h1>
        <div className='data_grid'>
            <div className='card_data'>
                <h4 className='title'>Contrato Típico</h4>
                {/* <p className='subtitle'>{this.props.data.pdfContent.raw.tipico}</p> */}
                <input type='text' className='data_edit' defaultValue={this.props.data.pdfContent.tratado.tipico}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Locatária</h4>
                <p className='subtitle'>{this.props.data.pdfContent.raw.locataria}</p>
                <input type='text' className='data_edit' defaultValue={this.props.data.pdfContent.tratado.locataria}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Tipo do imóvel</h4>
                <p className='subtitle'>{this.props.data.pdfContent.raw.tipo_imovel}</p>
                <input type='text' className='data_edit' defaultValue={this.props.data.pdfContent.tratado.area}></input>
            </div>
            <div className='card_data'>
                <h4 className='title'>Área do imóvel</h4>
                <p className='subtitle'>{this.props.data.pdfContent.raw.area}</p>
                <input type='text' className='data_edit' defaultValue={this.props.data.pdfContent.tratado.area}></input>
            </div>
        </div>
      </div>
    );
  }
}

export default EditExtracted;
